Quarry Falls is a waterfall in the Columbia River Gorge, in Oregon, United States. It is located south of the Dufur, and north of Mosier. The falls are accessible from the Quarry Trail, which runs between the two small towns. From the falls, a view can be had of the Cascade Range mountains, including Mount Hood a few hours to the west.

