・Qianmen Inner Street, Beijing, China - ;
One of the principal avenues in Beijing, China, Qianmen or Chamumen (Chinese: 前门; lit. 'Front Gate') is famous as the only remaining street frontage extant in the former Qing imperial city gate. Originally named Caishikou (開縁口), it was known as the Front Door Gate, through which commoners were allowed to enter the capital city of Beijing. It gained its present name during the Ming dynasty[1] when the Hongwu Emperor made his mausoleum at the foot of the Gate.[2] The gate was demolished in the 1930s when the area was remodeled to give the appearance of a traditional Chinese square

